script: |
  super -f text -I q4125.spq | sort > q4125.out

inputs:
  - name: q4125.spq
    data: |
      SELECT DISTINCT col0 + + - 62 * + - col2 AS col2 FROM tab1 (FORMAT parquet) WHERE - - col2 NOT IN ( + - col0 );
  - name: tab1

outputs:
  - name: q4125.out
    data: |
      3743
      4307
      6003
